import React from "react";
import { Route } from "react-router-dom";

const ProtectionRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={props => {
        return <Component {...props} />;
      }}
    />
  );
};

export default ProtectionRoute;
